import axios from 'axios'

//actionの実装
//状態遷移を管理する
export const READ_IVENTS = 'READ_IVENTS'

const ROOT_URL = 'https://udemy'

export const read_events = () => dispatch => {
    axios.get('${ROOT_URL}/events${QUERYSTRING}')
    dispatch({type: READ_IVENTS})
}
